import React from "react";

function Header() {
  function handleClick(e) {
    alert("click");
  }
  return (
    <div className="HeaderWrapper">
      <h1>EXPO</h1>
      <div className="quicklinks">
        <button onClick={handleClick} href="/info">
          Information
        </button>
        <p href="/locations">Interview Locations</p>
        <p href="/volunteer">Volunteer</p>
        <p href="/committee">Committee</p>
      </div>
    </div>
  );
}

export default Header;
